import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class RenderDOM extends Component {
    Change(){
        var container = document.getElementById("myId");
        var element = <h2> developer Sobug </h2>;

        ReactDOM.render(element, container);
    }
    render() {
        return (
            <div className="mt-5 text-center">

                <h1> React Dom Project </h1>
                <h2>render DOM</h2>
                <p> render() -> ReactDOM.render( element, container[, callback] ) </p>
                <button className="btn-danger mt-2" onClick={ this.Change }> change name </button>
                <h2 id="myId"> progrommer green </h2>
            </div>
        )
    }
}
export default RenderDOM
